import React from "react";
import styled from "styled-components";
import AddIcon from "@mui/icons-material/Add";
const Button = styled.button`
  padding: 13px;
  border-radius: 15px;
  background-color: rgba(249, 249, 249, 0.2);
  z-index: 12;
  position: absolute;
  left: 10px;
  bottom: 10px;
  cursor: pointer;
  border: none;
`;

const Image = styled.img``;

const Plus = () => {
  return (
    <Button>
      <Image src="/images/add.png" sx={{ fontSize: "17px" }} />
    </Button>
  );
};

export default Plus;
